import React from "react";
import "./Head.css";
import { HiGlobeEuropeAfrica } from "react-icons/hi2";
import { ImCtrl } from "react-icons/im";
import "animate.css";
const Head = () => {
  return (
    <section className="wrapper">
      {/*Left section*/}
      <div className="left">
        <ul className="l-menu">
          <li className="head">
            <button>
              <HiGlobeEuropeAfrica />
              <span>English</span>
              <ImCtrl />
            </button>
          </li>
        </ul>
      </div>
      {/*Right Section*/}
      <div className="right">
        <ul className="r-menu"></ul>
      </div>
    </section>
  );
};
export default Head;
